  {name: "Stretch Marks and Scars Cream - Best Body Moisturizer to Prevent and Reduce Old & New Marks - Natural & Organic for Pregnancy - Also for Men - 4 oz - By Body Merry", price: 17.99, description: "POPULAR FORMULA - Body Merry's Stretch Marks & Scars Defense Cream is a well-crafted and favorite among our customers looking to reduce and prevent stretch marks and scars. With our customized combination of high-quality ingredients, we've formulated a body butter that delivers intense hydration and results.\nNATURAL & GENTLE INGREDIENTS - Our body cream has an impressive ingredient list made up of Organic Cocoa Butter, Shea Butter, Vitamins E + C + B3 + B5, Sunflower Seed Oil, Plant Stem Cells, Organic Hemp Seed Oil, Organic Jojoba Oil, Evening Primrose Oil, Raspberry Seed Oil, Avocado Oil, Grapeseed Oil, Algae Extract and Japanese Green Tea Leaf Extract that are safe and gentle for every skin type.\nPENETRATING MOISTURE - This rich and creamy moisturizer harnesses the power of its premium ingredients to sink deep into your skin, leaving you with a smooth and supple feel. This velvety butter helps to restore moisture to cracked or dry skin on your feet, hands, arms, elbows and anywhere else your skin feels dehydrated.\nPERFECT AFTER THE SUN - Exposure to the sun can often dehydrate your skin and lead to dry, flaky and peeling skin. Unlike Aloe Vera gel, this mixture of effective ingredients makes this luscious cream a soothing product after time spent in the sun by replenishing hydration and nourishing parched skin.\nBody Merry offers a 90-day MANUFACTURER GUARANTEE on all its products. Just contact us and we'll refund your order. You get to keep the jar. We also prefer to cuddle with animals so none of Body Merry's products are tested on them. Our products are cruelty free and made right here in the USA in an FDA registered and GMP compliant facility.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41ZW8b%2B5NQL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Stretch-Marks-Scars-Cream-Moisturizer/dp/B00OTZ28DE%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00OTZ28DE", rating: 4.3, category: "Health and Beauty"},
