  {name: "Stretch Mark Cream - For Stretch Mark Removal & Prevention - Moisturizing Body Cream Treatment - Fades Marks & Scars - For Pregnant Women, After Birth, & Men - Natural & Organic - InstaNatural - 4 OZ", price: 17.95, description: "Diminishes Appearance of Existing Stretch Marks & Scars - Reduce current \"tiger strips\" and scars with our powerful cream that will heal the skin to fade away those reddish-blue stripes on the body. Helps restore skin tone and texture for a more even appearance. Full of Natural & Organic Ingredients\nPrevent New Ones From Forming - Not only can you fade away current blemishes with this powerful cream, but also you can prevent new ones from forming. This prevention cream strengthens and protects against future marks, and makes it harder for the skin to stretch beyond its limit.\nPowerful & Nourishing Hydration - Our body cream moisturizer is full of natural and organic ingredients - such as Vitamin C, Cocoa Butter, Rosehip Oil, & Mango Butter - that provide unsurpassed hydration and moisture to nourish your skin. Use all over the body, even hands and feet, to get softer, suppler skin.\nFor Men & Women - Stretch marks are a common occurrence on both men and women. For women, more than half will accumulate them during pregnancy, most likely on their tummies and stomachs. Our topical cream is perfect to use whether it is during pregnancy or after birth. For men, apply it on common trouble spots, such as the abdomen, chest, arms and shoulders. Also Reduces and Fades Away Marks & Scars\nManufacturer Guarantee - InstaNatural backs their products with a Lifetime Money Back Guarantee, no matter where you buy our product. If you're not satisfied, simply contact us and get a full refund.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51mb92MIZ0L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Stretch-Mark-Cream-Moisturizing-InstaNatural/dp/B00O14R17Q%3FSubscriptionI