  {name: "Purest Garcinia Cambogia Extract, Highest Grade & Quality 82% HCA (Best Formula) - Pure & Potent with Extra Strength - Safe & Effective Weight Loss Supplement - 120 capsules & USA Made By Natures Design", price: 18.55, description: "By using the same purity, potency, and servings size of a Garcinia Cambogia Extract formula that was used in the clinical trials, you can be certain you are receiving the highest quality Garcinia Cambogia Extract available.\nWe guarantee this is the highest quality and purest grade garcinia made in the USA and back it with a Money-back Guarantee (no questions asked - Select Garcinia).\nPremium & potent garcinia cambogia extract w/ 82% HCA capsules along with chromium, calcium and potassium for added weight loss benefits  - Rapid dissolving vegetarian capsule helps the active ingredients metabolize in the body so very little product \"is wasted\" and passed through your system (no fillers).\nContains optimal amounts/serving of key ingredients (recommended and approved by research verified experts) - HCA blocks fat by inhibiting a key enzyme that your body needs to make fat from carbohydrates: Citrate lyase. Usually carbohydrates or sugars that are not used immediately or stored in other forms are converted into fats. When HCA inhibits citrate lyase, the fat-making process is halted and the production of LDL (bad cholesterol) and triglycerides decrease. Our Plus Garcinia is fully reviewed.\nHCA also suppresses appetite by increasing serotonin levels. Serotonin is a neurotransmitter in your brain that makes you feel good. It's a target of many antidepressant medications. Having low levels of serotonin may make you feel depressed or anxious; it drives many people into emotional or reactive eating. By increasing serotonin levels, HCA improves mood and suppresses the drive to react to stressful situations with food. As you eat less, your body senses this and it releases stored fat in your fat cells.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/61lmxDjfCKL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Garcinia-Cambogia-Extract-Highest-Quality/dp/B00HDPZCH6%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00HDPZCH6", rating: 4.2, category: "Health and Beauty"},
