  {name: "PREMIUM Quality, Genuine Siberian Cedar (Pine) Nut Oil - 3,5oz / 100ml. For those who appreciate excellent quality. Read more...", price: 36.0, description: "Dear Ladies and Gentlemen,  We are glad to represent first premium grade, genuine Siberian cedar (pine) nut oil made in kin domain eco settlement. The oil is made from organic, wild harvested cedar nuts; it is 100% natural, extra virgin, cold pressed by wooden presses, first press only 100% pure cedar nut oil. No additives, No preservatives, No colorants or other ingredients.  The oil made in small amounts and shipped to our USA warehouse by air every two months. The oil is always fresh. The freshness is preserved by refrigerated storage and priority mail delivery.  With premium grade Siberian cedar nut oil we offer premium package and premium customer services:  Packaging include premium, medicinal grade brown glass bottle and medicinal grade plastic cap made in Germany. Decorated with 24 karat yellow gold. The bottle is held by white cardboard safety case and packed in carton box with premium design.   Premium customer service includes our priority attention to order, next business day shipment by priority mail service, full insurance and phone support.   The distinctive characteristic of current product is the quality of the product which does not allow for tradeoffs. Initially we developed the product based on the best traditions of Siberian experts of cedar nut oil pressing; we are using only high quality Italian laboratory equipment and German medicinal grade packaging. Our company has been producing cedar nut oil since 2002 at our own production base in Russia. We accumulated extensive experience and knowledge of high quality cedar nut oil making and we confidently state that our cedar nut oil is exceptional and does not have any analogs on the market.  Also we offer superior grade and regular grade of pine nut oil, please check our entire stock.      Several words how we made unique Siberian cedar nut oil and who work for you.\nThe brand name \"THE RINGING CEDARS OF RUSSIA\" stands for business integrity, decency and the highest possible quality of product. All products marketed under this brand name convey the primordial power of Nature and the warmth of our hearts. We offer: •\tA variety of high-quality cedar products, including cedar nuts, cedar flour and cedar nut oil. Huge plantations of cedar trees grow in the Siberian taiga, said to be the ecologically purest area of the world. The virgin forest of the taiga has never been treated with any chemicals or artificial fertilisation, nor abused by agricultural machines. Cedar nuts (the seeds of the cedar tree) take two years to mature, during which time the tree accumulates a huge volume of positive cosmic energy. Crops of nuts are harvested manually by people lovingly devoted to this task, working in a pleasant environment without undue haste to create unique products full of positive energy reflecting the infinite powers of Nature. Specific preparations include: •\tWe pick only cedar cones which fall naturally from the trees, thus ensuring that only ripe cones are selected. We always avoid hitting the trees to shake unripe cedar cones down (as happens with some other commercial operations) - a practice which causes the nuts to lose their healing power. •\tCones are then manually shelled with the help of wooden shell-removers. Nut centres are separated from their shells using wooden rollers. Cedar nut oil marketed under our brand name is obtained by the cold-pressure method, using manual wooden oil-presses. •\tCedar nut oil is then stored in special containers and packed in a Kin Domain \"Sunny Meadow\" located near Tomsk city using unique technology to avoid any contact with metal. The whole process is strictly supervised to ensure it complies with all sanitary requirements.\nFinal products are placed in special packaging to prevent daylight penetration, and stored at a temperature of 0°C to +5°C to better preserve the product's natural components. The resulting product is a bright gold-coloured liquid with the pleasant smell of cedar nuts. It is a 100% natural product with strong healing powers. Special steps have been taken to protect \"THE RINGING CEDARS OF RUSSIA\" cedar nut oil against counterfeit. Each box has a holographic label with a unique number attached to the side. * * * Ringing Cedars of Russia Company is happy to introduce you the family who makes the Siberian cedar nut oil in their own Space of Love in Kin's Domain.  ***  Our family consists of four persons: Eugen, the head of the family; Nadezhda, his constant and faithful support; and Anna and Dimitry, their two talented and intelligent children. Until 2008, we lived outside of Russia, in Germany, where we went in 1999 to live permanently. We were seeking a better, more peaceful and happy life. We lived there for nine years, but our happy future moved further and further away from us. We began to analyze our past and present. We reappraised many things and our values. Our way of life at that time did not suit us at all. A great desire awakened to move to Russia and live on the land. But we still had no confidence that our decision would change anything for the better. But some time later, the Ringing Cedars of Russia books fell into our hands. As we now realize, it was not by chance. Reading the books was a turning point for us. Once we discovered the answers to a multitude of questions, there came an understanding of everything that had happened. We were seized with the desire to change a great many things as quickly as possible and simultaneously to find our own place on the land and settle down there forever. Since we were born in Siberia (Tomsk Oblast), these areas were nearest and dearest to us.\nAfter a short search of kin's estates, we happened to come across the organizers of the Solnechnaya Polyana settlement. That same summer, we took our holidays and went to resolve the matter of a parcel of land. Our request was approved, and several options of unoccupied parcels were suggested to us. One of these appealed to us more than the others: a field with various grasses and nothing else. This was the \"blank canvas\" on which we were destined to create a space to be our home. In March 2008, we made the definitive move from Germany to Tomsk and began to set up our Kin domain. We built a small house and bath-house. In the spring and summer, we are busy with planting, and in the autumn we collect a harvest of vegetables and some berries; in the winter we make plans for the future. Since in our area there are many wild berries and cedar forests and taiga, and we ourselves are great nature lovers, we decided to get involved in the harvesting of cedar nuts, thus benefiting others and receiving enjoyment from our work.  For us the domain is a space of love and a living environment with clean air, water, and food. With its abundance, it guarantees our family self-sufficiency, and will provide the opportunity and time to engage in creative activities. And the very creation of the domain is already our joint creative venture, in which we all participate, and each reveal ourselves in our own way. Now, as we set up our domain, we feel completely that we are overflowing with wonderful bright feelings; we want to bestow our love on everyone. When you are in our domain, you truly enjoy life; this we have felt ourselves. Living at the Kin Domains in the Space of Love we understand simple truth that we want to create the best quality products. We considered all advices from Anastasia and created same Siberian Cedar Nut Oil which she prepared for Vladimir.\nWe also developed the highest quality packaging. We took best available medicinal grade glass bottle from Germany. We decorated it with pure gold and packaged to the box with the design inspired by Anastasia. Please enjoy the World Best Cedar Nut Oil from Kin Domain! Sincerely, Eugen Shtern Kin Settlement \"Sunny Meadow\".  IMPORTANT: Experts believe that allowing Siberian Cedar Nut Oil to come into contact with metal is not recommended (therefore it should not be stored or consumed using metallic objects). The Ekaterinburg Journeyman Foundation, a producer of Siberian Cedar products, explains this as follows: \"Contact between the oil and metal initiates the transformation of unsaturated fatty acids into saturated ones, which significantly reduces the oil's antioxidational properties. The natural information is also neutralized.\"  NO RETURNS ON A FOOD PRODUCT", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/518vT6BWiAL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/PREMIUM-Quality-Genuine-Siberian-Cedar/dp/B01764ECYC%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB01764ECYC", rating: 0.0, category: "Grocery"},
