  {name: "Owlet Baby Monitor - Infant Heart Rate and Oxygen Monitor (Current Version)", price: 249.99, description: "RELAX KNOWING YOU HAVE A PERSONAL MESSENGER THAT IS DESIGNED TO ALERT YOU IF YOUR BABY STOPS BREATHING - As the parent of a newborn, nothing is more stressful than not knowing what is wrong with your mysterious little being. Is she cranky, hungry....or is it something more serious? Should you just calm her down, or do something more? You need to know your child's health status NOW, and whether or not you have any immediate cause for concern. Owlet acts as a guardian, standing watch over your child at night. You'll feel an immense sense of RELIEF wash over you knowing that Owlet is designed to alert you if your baby stops breathing, or if her little heart rate is too high or too low. The sense of security is priceless.\nRECLAIM THE ENERGY & VITALITY THAT IS STRIPPED FROM YOU DURING \"BABY BOOT CAMP\" - When you make it through the first 6 months, and break through to the other side of parenthood, the pride and joy that swells inside you is enormous. But no matter how tough you are, and no matter how many kids you've had, those first few months are EXHAUSTING. All of those obstacles that come along with brand new babies - the worry, the lack of sleep, having an equally strung-out partner - they all take their toll. So when you know that the most CRITICALLY IMPORTANT aspects of your baby's health are being monitored by the same technology used in hospitals, it's a godsend that provides invaluable peace of mind.\nFEEL A SENSE OF RELIEF USING SAFE, TIME-TESTED & PROVEN TECHNOLOGY - The Owlet Monitor utilizes pulse oximetry, and it has been around for decades. It's that little red light they clip on your finger when you go to the hospital. It is also the same technology that is found on the new Apple Smartwatch. When you slip this Smart Sock on your baby's foot, it silently measures heart rate and oxygen levels. It then sends that information to the app on your iPhone (or any device running iOS 8 and higher), as well as to a Base Station. The two work in tandem, and will sound an alert if your infant's heart rate dips too low or spikes too high. Additionally, the Smart Sock has the essentials... it's hypoallergenic, Latex Free, BPA Free, and Lead Free, and fully adjustable so that your baby will feel as comfortable as you will when the Owlet is securely in place.\nSAVE YOURSELF TIME LOOKING FOR THE PERFECT BABY GIFT IDEA - Know someone who is expecting? Your friend's child is the single most important thing in her world right now. And despite the joy that this little miracle brings, she is bound to be highly stressed. Give her some peace of mind in this chaotic time, and give her the gift of safety for her baby. Sure, the baby registry is full of some cute, and even practical items. Teething toys, onesies and diaper bags are sure to maker her life easier. But nothing compares to how she will feel knowing that her baby is being watched over by the smartest monitor in today's world of baby health essentials.\n100% GUARANTEED TO GIVE YOU PEACE OF MIND OR YOUR MONEY BACK - If you don't think that this is the absolute best baby heart rate and oxygen monitor available on Amazon, simply ask Amazon for a complete and full refund with just one click. Get your money back directly from Amazon - no questions asked. We use the Owlet with our own children and swear by it; we want you to swear by it too. Allow yourself to relax TODAY, knowing that your baby is protected by an extra layer of the most advanced home technology available - CLICK Add to Cart NOW...", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51YGHtTrrTL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Owlet-Baby-Monitor-Current-Version/dp/B013PY7FJQ%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB013PY7FJQ", rating: