  {name: "Rodent Repeller-double Output-three Modes of Operation, 24 Hour Coverage, the Latest Technology in Pest Control,best Electronically Repels Rodents", price: 48.99, description: "◆2X OUTPUT OF MULTI- FREQUENCY ULTRASONIC WAVES ：The\"OWL\" Rodent Repeller is the latest technology in rodent control and one of the most powerful electronic rodent repellers on the market.It strategically combines ultrasonic & electromagnetic technology to force away rodents, cockroaches, spiders, roaches, ants, mice & rats quickly & easily ,and so that they simply leave your home & never come back again. Most customers can see fast results in  3-10 days!\n◆HUMANE AND SAFE:Automatically change the ultrasonic  frequencies.Although the ultrasonic sound drives rodents away, it is inaudible to humans and non-rodent pets. Child and pets safe.No more need for messy, dangerous traps or poisons. Perfect for ANY room in the house including kitchen, garage, basement or even the attic.\n◆FLEXIBLE PLUG:The plug can be 90 degree rotation.Easy for use.Simply Plugged  in to any standard household outlet (Input Voltage:90-240V)\n◆SAFE FOR YOUR HOME ELECTRONIC APPLAINCES:This produce is completely inoffensive for children and pets, and does not interfere with household appliances.By now clicking the \"Add To Cart\" button, your pest problem will be finally over!\n◆THREE MODES OF OPERATION(MODERATE\\AUTO\\HIGH)：1）MODERATE-(output 100dB)The GREEN LED will FLASH to indicate that the device has entered a medium output for daytime use. 2）AUTO-The BLUE LED will illuminate to indicate that the device has entered automatic mode.(Auto Mode: alternating from medium output of 100dB to high output of 110dB)Auto mode function changes the output from medium to high at night.At night, rodents are most active and a higher output is needed.3)HIGH-The BLUE LED will FLASH to indicate the device has entered a hight output for nighttime use.IF you go out or not at home for a long time，Advice use HIGHT。", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51k6vr406TL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Repeller-double-Output-three-Operation-Technology-Electronically/dp/B016Q4WO9S%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB016Q4WO9S", rating: 0.0, category: "Lawn & Patio"},
