egrees, allowing you to choose your preferred viewing angle. As an added bonus, we include a specialized cleaning cloth that works to remove dust, dirt & fingerprints, enhancing the view of your child.\nA PORTION OF PROFITS GO TO CHARITY. As a company, it is our mission to create love and happiness in the lives of all that we touch. That is why we donate a portion of proceeds from each baby mirror purchase to Child's Life Chances for Children Charity. By choosing to purchase a Cozy Greens back seat mirror for your vehicle, not only are you getting an amazing product at a price you can afford, but you are also helping improve the quality of life for other children.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51ofhIbTT4L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Cozy-Rear-facing-Cleaning-Traveling-Guarantee/dp/B00O6UCXUK%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00O6UCXUK", rating: 4.7, category: "Baby Product"},
