  {name: "Frutti Di Bosco Gelato Mix (Wild Berries)", price: 24.99, description: "Recipe for fruit flavors such as Fragola (strawberry), Banany (banana), Mandarino (mandarin/tangerine), Melone (melon), Pomplemo Rosa (pink grapefruit), Anguria (watermelon), Cedro (citrus), Frutti Di Bosco (wild berry), Pesca (peach), Cocco (coconut), Mela Verde (Green Apple). ACE (orange/carrot/lemon), Limoncello, or Panna (Plain): Add 3 quarts of either water (for sorbetto) or milk (for gelato).\nThe Yield: Depending on the batch freezer and the overrun (the volumetric difference between the quantity you put into the batch freezer and the quantity you produce, since air is whipped into and held by the mix during the freezing process), each bag will yield ~150 oz.\nThe Cost and Price per oz.: Based on this yield, and assuming you are serving 3 oz. servings for ~$3, with one bag of mix you can produce 50 servings for $150. Your cost is 12.5 cents per ounce, and the sales price is $1 per ounce. If this doesn't meet your financial goals, you can always increase your sales price.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/61DThKKAcgL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Frutti-Bosco-Gelato-Wild-Berries/dp/B005066W7E%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB005066W7E", rating: 0.0, category: "Grocery"},
