  {name: "Razer DeathAdder Chroma - Multi-Color Ergonomic Gaming Mouse", price: 50.0, description: "Ergonomic right-handed design with textured rubber side grips\n10,000dpi optical sensor\nChroma lighting with a wide range of customizable colors\nRazer Synapse enabled\nFive independently programmable Hype response buttons\nOn-the-fly sensitivity adjustment\nAlways-on mode\nGold-plated USB connector\nPerfectly designed to fit snugly under your palm, the ergonomic shape of the Razer DeathAdder Chroma gives gamers the most comfortable gaming experience ever, especially during the most testing of battles.\nThe Razer DeathAdder Chroma is equipped with a 10,000dpi optical sensor. It is capable of mouse movement speeds of up to 200 inches per second and 50g acceleration.\nYou can move it at either fast or low speeds, and it will always respond onscreen with exacting accuracy and the organic fluidity only possible with an optical sensor.\nThe Razer DeathAdder Chroma's sensor is also capable of tracking Z-axis to as low as 1mm on most surfaces including glass table tops. This is perfect for low-sense gamers who want to set tracking to cut-off as soon as they lift their mice.\nChroma lighting with 16.8 million customizable color options Whether you're in the mood for electric blue, pastel pink, or signature Razer green, you can now illuminate your Razer DeathAdder Chroma's scroll wheel and Razer logo just the way you want.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41SvcggT3xL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-DeathAdder-Chroma-Multi-Color-Ergonomic/dp/B00MYTSDU4%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00MYTSDU4", rating: 0.0, category: "Personal Computer"},
