  {name: "Razer Nabu X Smartband - Black", price: 37.98, description: "Discreet notifications. The Razer Nabu X offers a no-screen, no-fuss notification interface, meaning you keep your head up and in the game at all times.\nStay active. All tracked by Nabu X's accelerometer and algorithms, with progress displayed on the companion fitness app of your choice.\nBand together Nabu X is a social wearable, outfitted with Razer's proprietary Pulse technology to allow Nabu and Nabu X bands to \"talk\" to each other in a specified proximity.\nAll day wear Nabu X offers 5-7 days battery life, 30 days standby.\nOpen development platform The Razer Nabu and Nabu X both share integrations with the same apps and innovations.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/31HeQo1GJ5L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Nabu-X-Smartband-Black/dp/B00SVJK1LU%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00SVJK1LU", rating: 0.0, category: "Wireless"},
  {name: "Razer BlackShark Over Ear Noise Isolating PC Gaming Headset", price: 109.15, description: "Sound-isolating circumaural ear cup design\nDetachable boom microphone for voice chat or added mobility\nAudio/mic splitter adapter cable\nMemory foam leatherette ear cushions for maximum comfort\n40mm neodymium magnet stereo drivers with copper-clad aluminum voice coil drivers\nWith the circumaural design and leatherette sealant of the headset's ear cups, block out all unwanted, ambient noise and only hear the awesome, intense audio of your games and music\nThe Razer BlackShark's detachable boom microphone makes this a highly versatile headset, at home both at a gaming setup and out on the streets for music playback\nThe combined audio/mic cable works with all portable audio/mobile/computing devices including the iPod, iPhone, iPad, Kindle Fire, Android phones, Razer Blade, MacBook Pro, or today's newer Ultrabooks\nThe included audio/mic splitter extension cable lets you use the combined audio/mic capabilities of the Razer BlackShark on computers that use separate 3.5mm ports for audio output and microphone input", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51ao%2BY%2B3l1L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-BlackShark-Isolating-Gaming-Headset/dp/B00J8740YI%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00J8740YI", rating: 4.2, category: "Personal Computer"},
  {name: "Razer DeathStalker Essential Gaming Keyboard", price: 43.95, description: "Actuate as many keys as you have fingers, and have all of them register accurately and quickly in-game.\nWith the Razer DeathStalker's anti-ghosting capabilities, you can deliver overwhelming destruction to your opponents, and ensure that every command is registered and executed perfectly.\nRazer Synapse 2.0 is cutting-edge, intuitive software that functions as the Razer DeathStalker's brain, automatically syncing the gaming keyboard to a cloud server to download driver and firmware updates, while saving your individual settings.\nActuate as many keys as you have fingers, and have all of them register accurately and quickly in-game.^With the Razer DeathStalker's anti-ghosting capabilities, you can deliver overwhelming destruction to your opponents, and ensure that every command is registered and executed perfectly.^Razer Synapse 2.0 is cutting-edge, intuitive software that functions as the Razer DeathStalker's brain, automatically syncing the gaming keyboard to a cloud server to download driver and firmware updates, while saving your individual settings.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41eHvEvzScL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-DeathStalker-Essential-Gaming-Keyboard/dp/B00HKEI4HU%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00HKEI4HU", rating: 0.0, category: "Personal Computer"},
  {name: "Razer Ouroboros Elite Ambidextrous Gaming Mouse (Certified Refurbished)", price: 84.49, description: "This Certified Refurbished product is manufacturer refurbished, shows limited or no wear, and includes all original accessories plus a 90-day warranty\nThe Razer Ouroboros is outfitted with the most advanced and configurable sensor yet, the all-new 8200dpi 4G laser sensor.\nAre you ready to take your gaming further than before, cord-free? As Razer is the pioneer of the world's first gaming-grade wireless tech, you can be assured the Razer Ouroboros performs as well cordless as it does corded.\nStay on top of the competition and adapt to the situation with the Razer Ouroboros' dedicated DPI clutch-trigger. Hold it down to temporarily increase/decrease the mouse's DPI so you can get the exact sensitivity you need for the moment in-game.\nGame for longer cordless when the Razer Ouroboros is conveniently powered by a single AA battery with up to 12 hours of continuous gaming.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41AVYYMn3pL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Ouroboros-Ambidextrous-Gaming-Certified-Refurbished-Mac/dp/B00N12X07Y%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00N12X07Y", rating: 0.0, category: "Video Games"},
  {name: "2015 Fashion New Rubber Razer Goliathus Mantis Control Game Mouse Pad Mat (Locked) Large XL Size 900*300MM", price: 22.99, description: "Size:900 mm x 300 mmx3mm\nMaterial: Rubber\nLocked means the protection at the edge of the mouse pad.\nMouse Pad( Control Edition)\nHeight:3 mm", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/51DC0yI0FKL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Fashion-Rubber-Goliathus-Mantis-Control/dp/B00UFUU3EI%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00UFUU3EI", rating: 0.0, category: "Office Product"},
  {name: "Razer DeathStalker Ultimate Gaming Keyboard", price: 235.0, description: "Razer's award-winning, proprietary Switchblade User Interface puts more control in your hands with ten dynamic adaptive tactile keys and an LCD panel.\nRazer Switchblade UI features a wide array of applications such as our social media applications, game enhancing applications, and game specific applications.\n10 key-roll over in gaming mode. Actuate as many keys as you have fingers, and have all of them register accurately and quickly in game.\nRazer Synapse 2.0 is cutting-edge, intuitive software that functions as the Razer Death Stalker Ultimate's brain, automatically syncing the gaming keyboard to a cloud server to download driver and firmware updates, while saving your individual settings.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41JwwhDAP0L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-DeathStalker-Ultimate-Gaming-Keyboard/dp/B009YZXOVE%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB009YZXOVE", rating: 0.0, category: "Personal Computer"},
  {name: "Razer Goliathus Extended CONTROL Soft Gaming Mouse Mat", price: 32.36, description: "Low sense, high sense, laser, optical or dual sensor system -whatever your sensitivity setting or preferred gaming mouse, the Razer Goliathus offers total tracking responsiveness for consistently reliable in-game control.\nYours could be a tiny corner on a desk overflowing with stuff, a vast expansive space, or you're always on the move. Whatever your play-style and space needs, the Razer Goliathus comes in four different sizes to accommodate them all.\nThe weave also provides a nice, comfortable feel under your hand minimizing fatigue over extended periods of play.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41lfxO1oSEL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Goliathus-Extended-CONTROL-Gaming/dp/B00R9YH1ZC%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00R9YH1ZC", rating: 4.6, category: "Personal Computer"},
  {name: "Razer BlackWidow Tournament Edition Chroma", price: 149.99, description: "87 mechanical keys Provide a tactile feel, fast response time and full programming ability for optimal gaming performance.\nKeyboard controls Include media keys for volume control and media playback, as well as macro recording for repeated action sequences.\nCompact layout Enables quick typing and programming during gameplay.\nChroma backlighting Offers over 16.8 million color options for a customized appearance.\nCarrying case Offers additional protection while taking the keyboard on the go.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41Ab1jv2QbL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-BlackWidow-Tournament-Edition-Chroma/dp/B0165PDYEW%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0165PDYEW", rating: 0.0, category: "PC Accessory"},
