  {name: "Razer Kraken USB Over Ear PC and Music Headset - Black", price: 53.69, description: "Immersive virtual surround sound Everything from gunfire, to footsteps, voices, and even the wind in the trees can be heard with positional accuracy relative to your location in the game world\nUnidirectional analog microphone The unidirectional microphone of the Razer Kraken USB leaves no room for miscommunication: crystal clear audio reproduction, with balanced natural sounding tones, and little background noise pickup\nDesigned for extended gaming comfort Field-tested by countless sports athletes, the Razer Kraken USB is comfortable on your head and ears for extended gaming sessions\nIts fully adjustable headband and closed ear cups with plush padding ensure a perfect fit every time", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/31I82Sci5hL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Kraken-Over-Music-Headset/dp/B00LN0O0VG%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00LN0O0VG", rating: 0.0, category: "Personal Computer"},
  {name: "Razer Kraken PRO Over Ear PC and Music Headset - Neon Red", price: 77.95, description: "Optimized weight for extended wear\nFully retractable microphone\nPowerful drivers and sound isolation for highest-quality gaming audio\nOn top of being optimized for extended wear, the Razer Kraken Pro Neon is outfitted with a fully retractable microphone and powerful high-quality audio drivers that let you enjoy an immersive gaming experience for hours on end.\nWhether you're hitting the streets or gaming from home, the 3.5mm combined audio jack with splitter cable allows for seamless connectivity wherever you are.\nThe Razer Kraken Pro's large 40mm neodymium magnet drivers are tuned for clear high- and mid-ranges as well as deep bass for powerful lows.\nThe left ear cup houses a fully retractable microphone boom that pulls out only when you need it, perfect for taking your headset on the go.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41IzdFz7NFL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Kraken-Over-Music-Headset/dp/B00L0YM2RO%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00L0YM2RO", rating: 0.0, category: "Personal Computer"},
