  {name: "Razer Orbweaver Mechanical PC Gaming Keypad", price: 138.93, description: "Mechanical key infrastructure\n20 fully programmable keys and 8-way thumb-pad\nAdjustable hand, thumb, and palm-rest modules\nInstantaneous switching between 8 key maps\nBacklit keypad for total control even in dark conditions", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41IHYi6SDDL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Orbweaver-Mechanical-Gaming-Keypad/dp/B00B1N07QM%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00B1N07QM", rating: 0.0, category: "Personal Computer"},
