  {name: "Razer Abyssus Optical PC Gaming Mouse", price: 19.99, description: "3500dpi Razer Precision(TM) 3.5G Infrared Sensor\n3 Buttons Tuned For Ultra-Responsive Feedback3 Buttons Tuned For Ultra-Responsive Feedback\nHardware Toggles for DPI and Polling Rate", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/313rUhYPnFL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Abyssus-Optical-Gaming-Mouse/dp/B002XLR0JI%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB002XLR0JI", rating: 0.0, category: "CE"},
  {name: "Razer Seiren Elite USB Digital Microphone", price: 179.22, description: "High definition studio-grade recordingBuilt into the Razer Seiren are three 14 mm custom tuned condenser capsules in an array that is capable of 4 different recording pattern configurations.\n4 Dedicated recording patterns for multiple applications Different recording applications call for specific recording patterns that best accommodate the use case.\nZero latency headphone output for accurate monitoringThe Razer Seiren comes with a built in headphone amplifier that accommodates any monitoring headphone that has a 3.5 mm jack.\nUSB plug & play recordingThe Razer Seiren is made to be an easy to use plug and play USB microphone - no fuss involve.\nShock mount for minimal noise (optional accessory)Made to fit the Razer Seiren perfectly, this sleek full-aluminum shock mount suspends the mic and reduces the noise generated from unwanted vibrations.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/31CyHR5JWkL.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Seiren-Elite-Digital-Microphone/dp/B00QXT5M3C%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00QXT5M3C", rating: 4.1, category: "Personal Computer"},
