  {name: "Razer Goliathus Extended SPEED Soft Gaming Mouse Mat", price: 24.93, description: "Low sense, high sense, laser, optical or dual sensor system -whatever your sensitivity setting or preferred gaming mouse, the Razer Goliathus offers total tracking responsiveness for consistently reliable in-game control.\nYours could be a tiny corner on a desk overflowing with stuff, a vast expansive space, or you're always on the move. Whatever your play-style and space needs, the Razer Goliathus comes in four different sizes to accommodate them all.\nThe weave also provides a nice, comfortable feel under your hand minimizing fatigue over extended periods of play.", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41qjrBCg7ML.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Goliathus-Extended-SPEED-Gaming/dp/B00ETHLPVI%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00ETHLPVI", rating: 4.7, category: "Personal Computer"},
  {name: "Razer Goliathus Standard Mouse Mat - Speed Surface", price: 8.0, description: "Slick Cloth Weave - The Razer Goliathus Speed Edition's highly taut weave creates a slick, seamless surface that trumps all other gaming cloth mats on the market in terms of flat-out speed.\nOptimized for All Sensitivity Settings and Sensors - The Razer Goliathus Speed Edition is optimized for use with all gaming-grade mice, regardless of sensitivity settings and sensor type.\nAvailable in Three Mat Sizes - Select a mat size that fits your playstyle as perfectly as it does your desktop: Alpha (Large), Standard (Medium), Omega (Small)", photo: "", photo_file_name: "http://ecx.images-amazon.com/images/I/41kAUVrqJ-L.jpg", photo_content_type: "", photo_file_size: 0, photo_updated_at: nil, url: "http://www.amazon.com/Razer-Goliathus-Standard-Mouse-Mat/dp/B002R0DX0K%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB002R0DX0K", rating: 0.0, category: "CE"},
